import * as React from 'react';
import { Button } from 'react-native-web';
import { Header,Container,Title,HeaderButtonLeft,HeaderButtonRight,Container1,Container2,Container3,Container4,Text1,Text2,Text3,Text4,Title1,Button1} from './styles';
import { View,StyleSheet,Text} from 'react-native';
import { Entypo } from '@expo/vector-icons';
import { Ionicons } from '@expo/vector-icons';



function AddAlarmScreen({navigation,route}) {
    const item = route.params;
    return(
        <Container>
            <Header>
                <HeaderButtonLeft>
                    <Ionicons name="chevron-back" size={20} color={"black"} onPress={navigation.goBack} />
                </HeaderButtonLeft>
                <HeaderButtonRight>
                    <Entypo name="dots-two-horizontal" size={20} color="black" />
                </HeaderButtonRight>
                <Title>Add Alarm</Title>
            </Header>
            <Container1>
            <View style={{position: 'absolute',width: 20,height: 20,left: 45,top: 117}}><Ionicons name="bed-outline" size={24} color="black" /> </View>
                <Text1>Bedtime</Text1>
            </Container1>
            <Container2>
                <Text2>Hours of sleep</Text2>
            </Container2>
            <Container3>
                <Text3>Repeat</Text3>
            </Container3>
            <Container4>
                <Text4>vibrate When Alarm Sound</Text4>
            </Container4>              
            <Button1 onPress={() => navigation.navigate('Tela 6')}>               
                <Title1>Add</Title1>
            </Button1>
        </Container>
        
    );
};


export default AddAlarmScreen;
